import { Link } from 'react-router-dom'

class SimilarLicenses extends Component {
	constructor(props) {
		super(props);
		this.state = {
			'found': null
		}
		this.getSimilarLicenses()
	}

	// This will look for other licenses that may have the same organization name, so we can give the option to combine.
	getSimilarLicenses = (licNum) => {
		console.log('~~~',this.props.name)
		let licDetailsCall = ['https://data.lcb.wa.gov/resource/bhbp-x4eb.json?'];
		licDetailsCall.push('$where=organization like "'+this.props.name+'" ')
		console.log('+++',licDetailsCall.join(''))
		fetch(licDetailsCall.join('')).then(response => response.json()).then((a,b,c)=>{
			console.log('!!!',a,b,c)
		})
	}

	render(){ 
		const licenseDetails = this.props.data;
		console.log(licenseDetails)
		if(licenseDetails.length > 1){
			return null
		}else if(this.state.found===null){
			return null
		}else{
			return (
				<div className={'similar-licenses'}>
					{this.props.name} <hr/>
					This box will show similar licenses based on orginization name
					}
				</div>
			)
		}
	}
}

export default SimilarLicenses;
